import Link from 'next/link';

const linkStyle = {
    marginRight: 15,
    background: 'red'
  };
 


  const Navbar = () => (
    <div>
      <Link href="/">
        <a style={linkStyle}>Home</a>
      </Link>
      <Link href="/about">
        <a style={linkStyle}>About</a>
      </Link>
      <style jsx>{`
        background-color: red;
        color: white;
        width: 100%;
        height: 60px;
        display: flex;
        alignContent: center;
    `}</style>
    </div>
    
  );
  
  export default Navbar;
